import React from "react";
import "./App.css";
import "../src/components/layout/Navbar";
import Navbar from "../src/components/layout/Navbar";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

const App = () => {
  return (
    <Router>
      <div className='App'>
        <Navbar />
        My App
      </div>
    </Router>
  );
};

export default App;
